import React from "react";
import styled from "styled-components";
import LinkedContents from "./LinkedContents";

const ImageSliderContainer = styled.section`
  height: 80vh;
  width: 100vw;
  position: relative;
  overflow: hidden;
  img {
    width: 100%;
    position: relative;
    /* 이미지 위치 조절 */
    top: -40vh;
  }
`;

const ImageSlider = () => {
  return (
    <>
      <ImageSliderContainer>
        <LinkedContents />
      </ImageSliderContainer>
    </>
  );
};

export default ImageSlider;
